import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import './App.css';

import Login from '../pages/Login/index'

function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path="/login" component={Login} />
        <Route exact path="/article/:id" component={Article} />
      </Router>
    </div>
  );
}

export default App;
